import React from "react";
import { YMaps, Map } from "react-yandex-maps";
import cl from "./About.module.css";

const About = () => {
  return (
    <div className={cl.about}>
      <YMaps>
        <Map
          defaultState={{
            center: [55.75, 37.57],
            zoom: 9,
            width: 1000,
            height: 100,
          }}
        />
      </YMaps>
    </div>
  );
};

export default About;
